import "./AddEditGradeForm.scss";
import { Form, Image, Button, Dropdown } from 'semantic-ui-react';
import { LEVEL, LETTER, D } from "../../../../utils"

export function AddEditGradeForm() {
  return (
    <Form className='add-edit-grade-form'>
      <Dropdown placeholder='Nivel' fluid selection search />
      <Dropdown placeholder='Letra' fluid selection search />
      <Dropdown placeholder='Jornada' fluid selection search />
      
      <Button type='submit' primary content="Crear" />
      
    </Form>
  )
}
